import React from "react";
import "../App.css";
function navigation(props){
    return (
        <div>
            <nav className="navbar">
                <ul>
                    <li><a href=".">Home</a></li>
                    <li>Band</li>
                    <li>Tour</li>
                    <li>Contact</li>
                </ul>
            </nav>
        </div>
    );
}
export default navigation;
